import React from "react";
// import "./MehreenStyles.css"
import ReactBootstrap, {Nav, Button, Navbar,NavDropdown,Form,FormControl} from 'react-bootstrap';
import 'bootstrap/dist/css/bootstrap.min.css';
// import Scrollchor from 'react-scrollchor';
import GuestLinks from './guestlinks';
import LoginLinks from './loginlinks';
import firebase from './fire';
import {withRouter} from 'react-router-dom';

function Header(props) {

    return (
        <div>
        <Navbar className="nav-link" expand="lg">
      
          <Navbar.Toggle aria-controls="basic-navbar-nav" />
          <Navbar.Collapse id="basic-navbar-nav">
          <a style={{background: "#955F61",color: "white"}} class="navbar-brand" href="/">Khana Shana </a>
          {firebase.getCurrentUsername ? <LoginLinks/> : <GuestLinks/>}
          </Navbar.Collapse>
        </Navbar>
      </div>
    );
}


export default withRouter(Header);
